import React from 'react';
import {add,mult,subt,div} from './Calc';

function App(){
return(
    <>
    <ul>
        <li>{add(40,4)}</li>
        <li>{mult(40,4)}</li>
        <li>{subt(40,4)}</li>
        <li>{div(40,4)}</li>
    </ul>
    </>
);
}

export default App;
